$(document).ready(function () {
    $(document).on("click", ".ticket-pdf", function() {
        //console.log("hola");
        var ticketid = $(this).parents(".ticket").attr("data-ticket_id");
        //console.log(ticketid);
        ticketPDF(ticketid);
    });
    
    function ticketPDF (ticketid) {
        $.post("php/ticketPDF.php", {"get_ticketDetails": true, ticketid: ticketid}).done(function(data) {
            var ticketDetails = $.parseJSON(data);
            if (ticketDetails != "0 results") {
                var newRow = [];
                var rowsTicket = [];
                var colsTicket = [
                    {text: "Cuenta", style: 'tableHeader'},
                    {text: "Ticket", style: 'tableHeader'},
                    {text: "Solicit√≥", style: 'tableHeader'},
                    {text: "Fecha", style: 'tableHeader'},
                    {text: "Asunto", style: 'tableHeader'},
                    {text: "Estatus", style: 'tableHeader'},
                    {text: "Horas", style: 'tableHeader'},
                    {text: "Ing. Asignado", style: 'tableHeader'}
                ];
                var status = "";
                    
                switch(ticketDetails[0]["status"]) {
                    case "Open":
                        status = "Abierto";
                        break;
                    case "In Progress":
                        status = "En Progreso";
                        break;
                    case "Wait For Response":
                        status = "Esperando respuesta";
                        break;
                    case "Closed":
                        status = "Cerrado";
                        break;
                }
                
                newRow = [
                    {text: ticketDetails[0]["cuenta"], style: 'ticketInfo'},
                    {text: ticketDetails[0]["ticket_no"], style: 'ticketInfo'},
                    {text: ticketDetails[0]["solicito"], style: 'ticketInfo'},
                    {text: formatCompDate(ticketDetails[0]["dia_cita"]), style: 'ticketInfo'},
                    {text: ticketDetails[0]["title"], style: 'ticketInfo'},
                    {text: status, style: 'ticketInfo'},
                    {text: ticketDetails[0]["hours"], style: 'ticketInfo'},
                    {text: ticketDetails[0]["asignado"], style: 'ticketInfo'}
                ];
                rowsTicket.push(colsTicket);
                rowsTicket.push(newRow);
                //console.log(rowsTicket);
                $.post("php/ticketPDF.php", {"get_ticketComments": true, ticketid: ticketid}).done(function(data) {
                    var ticketComments = $.parseJSON(data);
                    if (ticketComments != "0 results") {
                        for(var i in ticketComments) {
                            newRow = [{text: ticketComments[i]["comments"]+" ["+ticketComments[i]["autor"]+". "+formatCompDate(ticketComments[i]["createdtime"])+"]", colSpan: 8, style: 'tableComment'}, '', '', '', '', '', '', ''];
                            rowsTicket.push(newRow);
                        }
                    }
                    var docDefinition = {
                        content: [
                            {
                              image: 'top2',
                              width: 150,
                              marginLeft: 350
                            },
                            {text: "Reporte de Ticket: "+ticketDetails[0]["ticket_no"], fontSize: 18, bold: true, marginTop: -20, marginBottom: 10},
                            {
                                table: {
                                    headerRows: 1,
                                    widths: ['auto', 'auto', 'auto','auto', 'auto', 'auto', 'auto', 'auto'],
                                    body: rowsTicket
                                },
                                marginTop: 15
                            }
                        ],
                        styles: {
                            tableHeader: {
                                fillColor: '#FF2B42',
                                color: '#fff',
                                alignment: 'center',
                                border: [false, false, false, false]
                            },
                            tableComment: {
                                fillColor: '#f5f5f5',
                                border: [false, false, false, false]
                            },
                            ticketInfo: {
                                alignment: 'center',
                                border: [false, false, false, false]
                            }
                        },
                        images: {
                            top2: 'data:image/png;base64,',
                            top: 'data:image/jpeg;base64,'
                        }
                    };
                    pdfMake.createPdf(docDefinition).download(ticketDetails[0]["ticket_no"]+'.pdf');
                });
            }
        });
        //console.log(rowsTicket);
        
        //pdfMake.createPdf(docDefinition).open();
    }
    
    function formatCompDate (mydate) {
        //return moment(mydate, "YYYY-MM-DD HH:mm:ss").format("DD/MM/YYYY hh:mm a");
        return moment(mydate, "YYYY-MM-DD HH:mm:ss").format("DD/MM/YYYY");
    }
});